import React, { useState } from "react";
import "./App.css";
import { Button, Card } from "./components";

const App: React.FC = () => {
  const [count, setCount] = useState(0);

  const handleClick = () => {
    setCount(count + 1);
  };

  return (
    <div className="App">
      <h1>Welcome to My React App</h1>
      <img src="./assets/logo.png" alt="" />
      <Card title="Primeiro Card" description="Este é um exemplo de componente Card que você criou!" />

      <Card title="Segundo Card" description="Você pode usar múltiplas vezes o mesmo componente com dados diferentes." />

      <Button label={`Clique aqui (${count} cliques)`} onClick={handleClick} />
    </div>
  );
};

export default App;
